import React from 'react';

const Experience = () => {
  return (
    <div>
      <h2>Experience</h2>
      <p></p>
      <p>Role: Software Engineer</p>
      <p>Duration: 2018 - 2022</p>
    </div>
  );
};

export default Experience;
